import { Divider, TextField, Button } from '@mui/material';
import Input from '@mui/material/Input';
import './Multi.scss';

export default function Multi(props) {
	return (
		<div id='multi' className='page'>
			<div id='sidebar'>
				<TextField label='Name' variant='outlined' style={{ marginTop: '20px' }} />
				<Divider />
				<Button style={{ backgroundColor: '#266308' }}>Join</Button>
				<Input placeholder='ID...' style={{ marginTop: '10px' }} />
				<Divider />
				<Button style={{ backgroundColor: '#266308' }}>Create</Button>
				<div id='created'>
					<div id='code'>
						<div>Aj1x901nzx0c9,</div>
					</div>
					<div id='players'>1/2 players</div>
				</div>
			</div>
		</div>
	);
}
